import React from "react";
import './register.css';

const Register = () => {
    const customStyles = {
        animation: "none", /* Disable animation */
        background: "none", /* Remove background */
        backgroundSize: "auto", /* Reset background size */
        minHeight: "auto", /* Reset min-height */
        display: "block", /* Reset display property */
        padding: "initial", /* Reset padding */
        justifyContent: "initial", /* Reset justify-content */
        alignItems: "initial", /* Reset align-items */
        /* Add any other specific styles you need */
      };

    return (
        <div className="override-body">
            <div className=" w-full py-16 text-white px-4 bg-yellow-600">
                <div className="max-w-screen-xl mx-auto grid lg:grid-cols-3 bg-white py-10">
                    <div className="lg:col-span-2 py-2 bg-blue-600">
                        {/* Content for the left column */}
                    </div>
                    <div className="bg-red-600 py-2">
                        {/* Content for the right column */}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Register;
